function Item({ item }) {
  return (
    <li className='task'>
      <div className='task-group'>
        <input
          type='checkbox'
          checked={item.checked}
          name={item.name}
          id={item.id}
        />
        <label htmlFor={item.id}></label>
      </div>
    </li>
  );
}

export default Item;
